import "./App.css";

import menu from "./assets/button/menu.svg";

const App = () => (
  <div className="App">
    <div id="navBar">
      <button id="profile"></button>
      <button>
        <img src={menu} alt="menu" />
      </button>
    </div>
  </div>
);

export default App;
